description:
I currently have a LOT of porn on my computer, and in order to make room for some more, I have to burn some of it to CD/DVD. But before I do that I thought I would take some of the porn and create and uplopad some torrents, starting with the oldest stuff first.

After I had created and uploaded the first &quot;Best of the WinMX years&quot; torrent, I found a lot more pictures that also was downloaded with WinMX buried deep in my harddisk, this gave me the idea to make a follow up to my first WinMX torrent, But unlike the first collection which contains some of the most common porn pics that was available on the WinMX network (the ones which always would appear in the search lists), this one could rather be considered to be a some sort of &quot;best of the rest&quot; type of compilation instead.

Since I want my porn torrents to have a certain degree of quality, I had to filter out a lot of the pictures, so out went all the pictures with huge ads slapped on them + all pics that had a very low resolution and/or was of a rather crap quality. I also removed some pics where the girls depicted in my opinion looked a bit too young, and as far as I know, all persons included here are of the age 18 or above.

Next thing I did was to try removing all duplicate files, something which wasn&amp;#039;t an easy task. There was no problems with duplicates that simply had different file names, but quite often the same picture was saved several times with different ads slapped on them, and the result was in the end many variants of the same picture. Since using file comparisation programs on these kind of pics are impossible, I had to try doing things manually, and although I belive I got rid of most duplicates, I can&amp;#039;t guarantee that there aren&amp;#039;t any left in this compilation. I also renamed a lot of the pics that either had ridiculously long file names or had a lot of keywords that didn&amp;#039;t quite match with the content.


In the end I had a rag bag mix of 1160 pictures with various sizes, qualities and ages of the girls depicted (the majority being teens).

Hope you will enjoy the pics!


